// main applications where to render all the componenets
import React, { Component } from "react";
import "./App.css";

// create class for component
class App extends Component {
  render() {
    return (
      <div
        className="text-center"
        style={{ color: "green", fontSize: "100px" }}
      >
        <h>Hello, World</h>
      </div>
    );
  }
}

export default App;
